import React,{Component}from 'react';
import RequsetTableRow from './RequestTableRow.component' 
import axios from 'axios';

export default class Download extends Component{
    constructor(props){
        super(props);
        
        this.state={Requests:[]};
    }
    componentDidMount(){
      //${this.props.userID}
        axios.get(`http://localhost:3000/Request/`)
        .then(res=>{this.setState({Requests:res.data})})
        .catch(err=>{console.log('Error'+err)})
    }

    RequestsList(){
      console.log(this.state.Requests[0])
        return this.state.Requests.map( currentRequests=>{
            return<RequsetTableRow
            Username={currentRequests.username}  email={currentRequests.email}
            SVM={currentRequests.SVM} File={currentRequests.File}
            key={currentRequests._id}/>;
        })
    }
    render(){
        return(
            <div >
                {this.RequestsList()}
            </div>
        )
    }
}
